const Nav = () => {
  return (
    <div>
      <nav className="headernav">
        <NavLink
          to="/aboutme"
          className={({ isActive, isPending }) =>
            isPending ? "pending" : isActive ? "active" : ""
          }
        >
          A propos de moi
        </NavLink>
        <NavLink>Massage Ã  domicile</NavLink>
        <NavLink>Tarifs</NavLink>
        <NavLink>Contact</NavLink>
      </nav>
    </div>
  );
};

export default Nav;
